import React, { Component } from 'react';


class NotesList extends Component {

  render() {
    return (
        <div className="notes-list-container">

        <h3>Title: {this.props.title}&nbsp;</h3>

        <h3>Content: {this.props.content}&nbsp;</h3>

        </div>
    );
  }
}

export default NotesList;
